(SELECT "ADS_imp_1_OUT"."KEY" AS "KEY", ("ADS_imp_1_OUT".impute_output_2 - 5.84333333333) * 0.361589677381 + ("ADS_imp_1_OUT".impute_output_3 - 3.054) * -0.0822688898922 + ("ADS_imp_1_OUT".impute_output_4 - 3.75866666667) * 0.856572105291 + ("ADS_imp_1_OUT".impute_output_5 - 1.19866666667) * 0.358843926248 AS anova_output_2, ("ADS_imp_1_OUT".impute_output_2 - 5.84333333333) * 0.656539883286 + ("ADS_imp_1_OUT".impute_output_3 - 3.054) * 0.729712371326 + ("ADS_imp_1_OUT".impute_output_4 - 3.75866666667) * -0.175767403429 + ("ADS_imp_1_OUT".impute_output_5 - 1.19866666667) * -0.074706470135 AS anova_output_3, ("ADS_imp_1_OUT".impute_output_2 - 5.84333333333) * -0.580997279828 + ("ADS_imp_1_OUT".impute_output_3 - 3.054) * 0.596418087938 + ("ADS_imp_1_OUT".impute_output_4 - 3.75866666667) * 0.072524075487 + ("ADS_imp_1_OUT".impute_output_5 - 1.19866666667) * 0.549060910727 AS anova_output_4, ("ADS_imp_1_OUT".impute_output_2 - 5.84333333333) * 0.317254547169 + ("ADS_imp_1_OUT".impute_output_3 - 3.054) * -0.324094352418 + ("ADS_imp_1_OUT".impute_output_4 - 3.75866666667) * -0.47971898733 + ("ADS_imp_1_OUT".impute_output_5 - 1.19866666667) * 0.751120560381 AS anova_output_5 
FROM "ADS_imp_1_OUT"), 
"DT_node_lookup" AS 
(SELECT "ADS_ano_2_OUT"."KEY" AS "KEY", CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= -1.1500607289671398) THEN 1 ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_3 <= 0.26844965607220383) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= -0.21997402630757468) THEN 4 ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_4 <= 0.06267883645027317) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_5 <= -0.40242963178219415) THEN 7 ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= 1.7908250406327464) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= 1.3793361796645682) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_5 <= -0.26207597580230557) THEN 11 ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_3 <= -0.5690818679935195) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= 1.2787950333702036) THEN 14 ELSE 15 END ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_5 <= 0.08133771384576471) THEN 17 ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_4 <= -0.02300149459065104) THEN 19 ELSE 20 END END END END ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_4 <= -0.1570399655868292) THEN 22 ELSE 23 END END ELSE 24 END END ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_5 <= -0.027853702556662585) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_5 <= -0.041096072718299737) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_4 <= 0.511531532929598) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_4 <= 0.09229505455797232) THEN 29 ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= 1.3591734788854912) THEN 31 ELSE 32 END END ELSE 33 END ELSE 34 END ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_4 <= 0.31612846653975657) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= -0.009785638901867483) THEN 37 ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_5 <= 0.07056641673139133) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_4 <= 0.19766493213441533) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_4 <= 0.1399570522237563) THEN 41 ELSE 42 END ELSE 43 END ELSE 44 END END ELSE 45 END END END END ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_4 <= -0.17930334864206854) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= 1.4897769083602306) THEN 48 ELSE 49 END ELSE CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= 2.520243668910137) THEN CASE WHEN ("ADS_ano_2_OUT".anova_output_2 <= 1.598842700064541) THEN 52 ELSE 53 END ELSE 54 END END END END AS node_id 
FROM "ADS_ano_2_OUT"), 
"DT_Output" AS 
(SELECT "DT_node_lookup"."KEY" AS "KEY", (SELECT "DT_node_data".node_id 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS node_id, (SELECT "DT_node_data".feature 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS feature, (SELECT "DT_node_data".threshold 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS threshold, (SELECT "DT_node_data".count 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS count, (SELECT "DT_node_data".depth 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS depth, (SELECT "DT_node_data"."Proba_0" 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS "Proba_0", (SELECT "DT_node_data"."LogProba_0" 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS "LogProba_0", (SELECT "DT_node_data"."Proba_1" 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS "Proba_1", (SELECT "DT_node_data"."LogProba_1" 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS "LogProba_1", (SELECT "DT_node_data"."Proba_2" 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS "Proba_2", (SELECT "DT_node_data"."LogProba_2" 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS "LogProba_2", (SELECT "DT_node_data"."Decision" 
FROM "DT_node_data" 
WHERE "DT_node_data".node_id = "DT_node_lookup".node_id) AS "Decision" 
FROM "DT_node_lookup")
 SELECT "DT_Output"."KEY" AS "KEY", CAST(NULL AS FLOAT) AS "Score_0", CAST(NULL AS FLOAT) AS "Score_1", CAST(NULL AS FLOAT) AS "Score_2", "DT_Output"."Proba_0" AS "Proba_0", "DT_Output"."Proba_1" AS "Proba_1", "DT_Output"."Proba_2" AS "Proba_2", "DT_Output"."LogProba_0" AS "LogProba_0", "DT_Output"."LogProba_1" AS "LogProba_1", "DT_Output"."LogProba_2" AS "LogProba_2", "DT_Output"."Decision" AS "Decision" 
FROM "DT_Output"